(13, 'Personal_Protective_Equipment_Detection_for_Construction_Site_Safety_using_YOLOv9', 'Personal Protective Equipment Detection for Construction Site Safety Using YOLOv9 Reynaldi Adidarma  School of Computer Science  Bina Nusantara University  West Jakarta, Indonesia reynaldi.adidarma@binus.ac.id Jonathan Maverick School of Computer Science  Bina Nusantara University  West Jakarta, Indonesia jonathan.maverick001@binus.ac.id  Lili Ayu Wulandhari School of Computer Science Bina Nusantara University West Jakarta, Indonesia lily.wulandhari@binus.edu Islam Nur Alam School of Computer Science Bina Nusantara University West Jakarta, Indonesia islam.alam@binus.edu tasks. of  accuracy,  and  reliability  for  PPE  detection Specifically,  the  research  aims  to  provide  valuable  insights into  optimizing  the  YOLOv9  model  to  enhance  safety compliance  and  minimize  accidents  on  construction  sites, thereby ensuring the well-being of construction workers. Neural  networks  often  face  the  issue  of  losing  valuable information when they process input data through many layers of  feature  extraction.  This  problem  is  especially  shown  in tasks  like  detecting  Personal  Protective  Equipment  (PPE), where images may lack sufficient details due to low resolution because of the environment, making it difficult to accurately identify protective equipment. Models trained on such images often  perform  poorly,  emphasizing  the  need  to  tackle information  loss  for  better  prediction  accuracy.  To  address this  challenge,  we  adopt  the  YOLOv9  algorithm,  which integrates  two  important  components:  The  Programmable Gradient  Information  (PGI)  and  the  Generalized  Efficient Layer  Aggregation  Network  (GELAN),  aimed  at  enhancing the efficiency of feature extraction [2].  auxiliary information  mitigates The  PGI  framework  facilitates  gradient  information propagation  across  network  layers,  enhancing  the  model’s detection capability. It consists of the main branch, auxiliary reversible branch, and multi-level auxiliary information. The reversible branch prevents information and data  loss caused by the deep network layers during the gradient updates, while multi-level error accumulation [2]. Meanwhile the Generalized Efficient Layer Aggregation Network (GELAN) introduced in YOLOv9 is a improving lightweight  network  architecture  aimed  at information  integration  and  propagation  efficiency  during model training [2]. By integrating CSPNet [3] and ELAN [4], GELAN efficiently aggregates network information, reducing information  loss  and  enhancing  interlayer  interaction.  This architecture is particularly advantageous for PPE detection in resource-constrained  environments  due  to  its  lower  quality and lower parameter count [2].  Abstract— Worker safety in construction sites hinges on effective Personal  Protective  Equipment  (PPE)  use,  yet  ensuring consistent  adherence  remains  challenging.  This  research underscores  YOLOv9\'s  potential  to  automate  PPE  detection, crucial  for  enhancing  safety  compliance  and  mitigating construction  site  hazards  effectively.  This  study  investigates  a PPE detection system employing the YOLOv9 object detection algorithm to bolster safety protocols. Evaluating two variants—compact  (YOLOv9-c)  and  extended  (YOLOv9-e)—using  the Roboflow  dataset,  results  indicate  YOLOv9-c  achieved  0.934 precision, 0.85 recall, and 0.905 mAP50 with SGD, while Adam showed  higher  recall  and  mAP50  but  slightly  lower  precision. YOLOv9-E  with  Adam  excelled  with  0.925  precision,  0.874 recall,  and  0.923  mAP50,  outperforming  SGD.  Challenges include data imbalance and static testing set limitations, urging future  work  on  dataset  balance,  optimizer  exploration,  and robustness testing for real-world applications.  Keywords—PPE Detection, YOLOv9, Object Detection I.  INTRODUCTION Construction sites have some risks to workers\' safety, with hazards from falls to exposure to harmful substances, Personal Protective  Equipment  (PPE)  plays  a  key  role  in  preventing these  risks  by  providing  a  barrier  between  workers  and potential  dangers  [1].  However,  ensuring  the  consistent  and proper  use  of  PPE  across  construction  sites  remains  a challenge. Traditional monitoring methods are often prone to human error, highlighting the need for automated solutions to enhance safety protocols. In response to these problems, this study proposes the implementation of a PPE detection system using  YOLOv9,  an  advanced  object  detection  algorithm,  to support construction site safety effectively and efficiently.  The  primary  objective  of  this  study  is  to  calculate  the prediction for Personal Protective Equipment (PPE) detection using  the  YOLOv9  algorithm,  with  a  specific  focus  on optimizing the effectiveness of YOLOv9. This system aims to identify  and  monitor  the  usage  of  essential  protective  gear such as protective helmets, eye wear, gloves, protective boots, etc on construction sites. By conducting an in-depth analysis, the  study  seeks  to  determine  the  best  parameters  for  the YOLOv9 algorithm to achieve superior performance in terms XXX-X-XXXX-XXXX-X/XX/$XX.00 ©20XX IEEE               II.  LITERATURE REVIEW A.  YOLOv9 Architecture YOLOv9 is built upon the strong foundation of Ultralytics\' YOLOv5  codebase.  As  the  latest  breakthrough  in  real-time object  detection,  YOLOv9  incorporates  innovative  methods such as Programmable Gradient Information (PGI) [2] and the Generalized Efficient Layer Aggregation Network (GELAN). This  advancement  marks  a  substantial  improvement  in efficiency,  accuracy,  and  versatility,  establishing  new standards on the popular MS COCO dataset. B.  Performance Evaluation Metrics In  the  field  of  machine  learning  and  computer  vision, particularly  in  object  detection  tasks,  evaluating  model performance  is  paramount.  Various  metrics  are  utilized  to assess  how  effectively  a  model  operates,  providing  insights into its  accuracy  and  reliability.  We  focus  on  three fundamental  performance  evaluation  metrics:  precision, recall, and mean average precision (mAP50). Precision measures the fraction of true positive predictions out  of  the  total  positive  predictions  made  by  the  model.  In other  words,  it  quantifies  how  many  of  the  detected  objects were correctly identified. A higher precision value indicates that the model has a low false positive rate, minimizing the number of incorrect detections. From paper [5] we know that the formula used for precision is shown in (1). ????????????????????????????????????  =  ???????????????? + ????????() Meanwhile,  recall  measures  the  fraction  of  true  positive predictions  out  of  the  total  actual  positive  instances.  It represents the model\'s ability to correctly identify and detect all  the  objects  present  in  the  dataset.  A  higher  recall  value suggests  that  the  model  can  capture  most  of  the  object instances without missing too many. The formula to calculate recall is shown in (2). ???????????????????????? =  ???????????????? + ????????() Although  precision  and  recall  provide  valuable  insights into model performance, they may not offer a complete view. Therefore,  we  used  the  mAP50  metric,  which  combines precision  and  recall  into  a  single  value  and  evaluates performance across various IoU thresholds. An IoU threshold of 0.5 means a predicted bounding box is a true positive if it overlaps  the  ground  truth  by  at  least  50%.  The  formula  for mean average precision is shown in (3). ???????????????? ???????????????????????????? ???????????????????????????????????? =  1????∑????=????????=1????????????() To understand these metrics better, consider the confusion matrix  in  Table  I,  which  defines  true  positives  (TP),  false positives (FP), false negatives (FN), and true negatives (TN). Precision measures how many of the predicted positive cases are actual positives, while recall indicates the percentage  of identified. actual  positive  cases Additionally, the false-positive rate represents the percentage of negative cases that were incorrectly predicted as positive. that  were  correctly By using these metrics, we can comprehensively evaluate the model\'s  performance,  balancing trade-off  between precision and recall. the TABLE I. CONFUSION MATRIX DEFINING TP, FP, NEGATIVES, AND POSITIVES prediction positive negative total positive True positives (TP) False negatives (FN) Positives (P) negative False positives (FP) True negatives (TN) Negatives (N) C.  Related Work In  the  realm  of  PPE  detection  methods,  two  primary methods  have  emerged:  sensor-based  and  computer  vision-based  approaches.  Sensor-based  methods  utilize  installed sensors  on  each  Personal  Protective  Equipment  to  monitor signals and assess the usage of PPE by workers. For example, Yang  et  al.  2020  [6]  employed  sensors  at  every  PPE  in  the workplace and using Wi-Fi router to detect and to ensure the PPE  usage,  while  Bauk  et  al.  2018 [7]  developed  a  tailored RFID-based  safety  model  for  workers,  they  install  RFID sensor  on  each  PPE  and  the  Ultra  High  Frequency  (UHF) RFID readers located at the port perimeter, are simulated in Matlab and OMNeT++. Hayward et al. 2022 [8] proposed an innovative PPE access control system that integrates PPE with location monitoring to verify correct usage, the system utilises a  remote  database  which  is  queried  for  each  tag  ID  that  is detected by the RFID system. However, these  sensor-based  methods  come  with drawbacks. They can be expensive because we need to install sensors on each Personal Protective Equipment, imagine we have 1000 pieces of equipment, that means we need to install 1000 sensors. It also requires intricate deployment, and their accuracy may be compromised by environmental restrictions and  specific  object  categories.  As  technology  evolves, computer  vision-based  methods  are  gaining  traction  in  PPE detection.  These  methods  can  be  broadly  categorized  into approaches  that  combine  image  processing  with  machine learning and those that leverage deep learning techniques. The former typically employs image processing to identify areas of interest and machine learning for classification. On  the  other  hand,  deep  learning  techniques  have  been instrumental  in  overcoming  challenges  associated  with traditional  methods.  Azizi  et  al.  2024  [9]  introduced  the concept of R-CNN, paving the way for deep-learning-based object detection in PPE. Subsequent advancements led to the development of two-stage object detection algorithms, such as Fast  R-CNN  and  Faster  R-CNN,  which  offer high  accuracy but can be computationally intensive due to their multi-step processes. To address the computational demands, one-stage object  detection  algorithms  like  YOLO  (You  Only  Look Once)  have  been introduced.  These  algorithms  can simultaneously detect and classify objects, thereby reducing computational  requirements.  Numerous  studies  have  further refined  these  algorithms  for  PPE  detection.  For  example, Dalmedico Gessoni et al. 2019 [10]. enhanced YOLOv3 for safety  equipment  detection,  Torres  et  al.  2021  [11]  using             YOLOv4 and Ding et al. 2023[9] improved YOLOv5-based algorithm by integrating Neural Style Transfer (NST) to the model. Despite these advancements, challenges persist in PPE detection.  The  diversity  of  on-site  conditions  and  the  small size  of  targets  can  hinder  accurate  detection.  Background interference  and  overlapping  targets  further  complicate  the recognition process. Therefore, this study aims to address the issues  mentioned  earlier  and  to  propose  an  efficient  and accurate method for PPE detection in industrial settings. III.  METHODOLOGY D.  Hyperparameter Tuning In this study, we utilized two distinct models derived from YOLOv9  which  is  the  YOLOv9-C  designed  as  compact variant  and for  extended the  YOLOv9-E  developed capabilities.  Additionally,  we  utilized  two  optimizers:  SGD (Stochastic Gradient Descent) optimizer and Adam optimizer. Our choice of using the Adam optimizer was influenced by its adaptiveness, as demonstrated in a previous study [14] using the  YOLOv3  model.  Similarly,  we  selected  the  SGD optimizer based on its proven effectiveness in a previous study [15] involving the YOLOv4 model. For this experiment, we set the learning rate to 0.01 for the SGD optimizer and 0.001 for the Adam optimizer. TABLE II. HYPERPARAMETERS SETTING FOR MODELS TRAINING Fig. 1. Experiment Workflow A.  Dataset In this paper, we used Roboflow open access datasets for Personal  Protective  Equipment  detection  [12].  The  dataset initially contained 3290 images before data preprocessing and 3126 images after data preprocessing and image annotation. The dataset includes images categorized into seven classes of personal  protective  equipment.  These  classes  represent  the various  types  of  personal  protective  equipment  that  are usually used to ensure safety in construction sites. B.  Data Pre-Processing Data  pre-processing  starts  with  creating bounding boxes for each image using tools provided by Roboflow, a website that  offers  functionalities  for  bounding  boxes,  resizing,  and image augmentation. The bounding boxes were determined by the coordinates of the smallest rectangle containing the object. After creating the bounding boxes, each image will be resized to 640 pixels to facilitate and ease up the model training. Then finally the images were reviewed to identify and fix potential errors  in  pre-processing,  such  as  wrong  missing  bounding boxes. C.  Data Annotation Data annotation is used to improve our model because it provides  necessary  labeled  data  for  the  training.  One  study using enhanced YOLOv5 demonstrates the importance of data annotation,  showing that  high-quality  annotated  data significantly  enhances  model  performance  [13].  The  data annotation process successfully labeled ± 95% of the datasets, resulting in a total of 3126 images. These include 311 images of dust masks, 149 images of eye wear, 644 images of gloves, 607  images  of  jackets,  610  images  of  protective  boots,  780 images of protective helmets, and 25 images of face shields. Models YOLOv9-c YOLOv9-c YOLOv9-e YOLOv9-e Optimizer  Learning Rate  Batch Size 8 SGD 0.01 Adam SGD Adam 0.001 0.01 0.001 8 8 8 E.  Testing Model and Evaluation Epoch 31 31 31 31 then trained  using The  model  was the  specified hyperparameters. During training, we feed the model with the Roboflow datasets that have been reduced. After completing the  training,  we  evaluated  its  performance  using  the  testing set.  The  findings  were  then  assessed  using  three  metrics, which  are  precision, recall,  and  average  precision. Additionally,  we  analyzed  the  confusion  matrix  to  further interpret the experiment’s results. IV.  RESULT AND DISCUSSION The training and evaluation of our models were conducted in  Google  Colab,  utilizing  the  Python  3  Google  Compute Engine  backend  with  GPU  support.  Table  III  presents  the results  of  our  experiment  for  each  model  and  optimizer combination.  TABLE III. MODELS TRAINING RESULT AND COMPARISON Models Optimizer Precision Recall  mAP50 YOLOv9-c YOLOv9-c YOLOv9-e YOLOv9-e SGD Adam SGD Adam 0.934 0.901 0.914 0.925 0.85 0.905 0.861 0.915 0.87 0.92 0.874 0.923 Based on the results, we found that the YOLOv9-C model trained with the SGD optimizer achieved a precision of 0.934, a recall of 0.85, and an mAP50 of 0.905. When trained with the  Adam  optimizer,  the  YOLOv9-C  model  achieved  a precision of 0.901, a recall of 0.861, and an mAP50 of 0.915. The  YOLOv9-E  model  trained  with  the  SGD  optimizer achieved a precision of 0.914, a recall of 0.87, and an mAP50 of 0.92. Meanwhile, the YOLOv9-E model trained with the Adam  optimizer  achieved  the  highest  performance,  with  a precision of 0.925, a recall of 0.874, and an mAP50 of 0.923. These results  demonstrate  that the  Adam optimizer is better suited  for the extended  type of YOLOv9, whereas the SGD  optimizer  performs  slightly  better  for  the  compact  type  in terms of precision. TABLE IV. CONFUSION MATRIX FOR COMPACT MODEL USING SGD OPTIMIZER Dust Mask Eye Wear Glove Jacket Boots Helmet Shield Back ground 0.93 0.01 0.06 Dust Mask 0.83 0.01 0.91 0.08 Glove 0.17 Eye Wear 0.92 0.98 0.96 0.08 0.68 0.06 0.02 0.03 0.24 Jacket Boots Helmet Shield 0.07 0.12 0.11 0.35 0.15 0.19 0.02 Back ground Given that the confusion matrices of the models are quite similar, we can analyze one as a representative example. From Table IV, we can see that the predictions for the shield class are lower than for other classes. The main reason for this is that the training data for the shield class is significantly lower than for other classes. Additionally, we can see that this model has already reached its maximum potential, as indicated by the precision results in Table III, which show an average of more than  0.9  for  each  model  with  different  combinations  of optimizers. Despite  the  promising  results,  our  study  has  several limitations. The imbalance in the training data, especially for the  shield  class,  affected  the  model\'s  performance  for  this category.  The  confusion  matrices  consistently  show  lower accuracy for the shield class due to its smaller training data size, highlighting the need for more balanced datasets. While the Adam optimizer provided better results for the extended YOLOv9-e model and the SGD optimizer performed slightly better for the compact YOLOv9-c model in terms of precision, further  experimentation  with  additional  optimizers  and hyperparameter  tuning  could  improve  performance.  Lastly, our evaluation used a static testing set, which may not fully generalize  to  real-world  scenarios.  Future  research  should include more diverse testing conditions to better assess model robustness. Additionally, models were trained and evaluated in  a  specific  computational  environment,  and  performance may vary on different hardware configurations. V.  CONCLUSION AND FUTURE WORK the  compact This study explored the performance of YOLOv9 models, specifically (YOLOv9-c)  and  extended (YOLOv9-e)  versions,  using  different  optimizers,  namely SGD and Adam. The training and evaluation were conducted in Google Colab with GPU support. Our results demonstrated that  the  YOLOv9-c  model  trained  with  the  SGD  optimizer achieved a precision of 0.934, a recall of 0.85, and an mAP50 of  0.905.  When  trained  with  the  Adam  optimizer,  the  same model achieved a precision of 0.901, a recall of 0.861, and an mAP50  of  0.915.  For  the  YOLOv9-e  model,  the  SGD optimizer resulted in a precision of 0.914, a recall of 0.87, and an  mAP50  of  0.92,  while  the  Adam  optimizer  achieved  the highest  performance  with  a  precision  of  0.925,  a  recall  of 0.874, and an mAP50 of 0.923. These findings indicate that the Adam optimizer is better suited for the extended YOLOv9 model,  whereas  the  SGD  optimizer  performs  slightly  better for the compact model in terms of precision. However,  the  study  revealed limitations,  particularly  the imbalance in the training data, which affected the performance for the  shield  class.  The  confusion  matrices  showed consistently lower prediction accuracy for this class due to its smaller  training  data  size.  Furthermore,  the  evaluation  was conducted  using  a  static  testing  set,  which  might  not  fully generalize to real-world scenarios. the  compact This study explored the performance of YOLOv9 models, (YOLOv9-C)  and  extended specifically (YOLOv9-E)  versions,  using  different  optimizers,  namely SGD and Adam. The training and evaluation were conducted in Google Colab with GPU support. Our results demonstrated that  the  YOLOv9-C  model  trained  with  the  SGD  optimizer achieved a precision of 0.934, a recall of 0.85, and an mAP50 of  0.905.  When  trained  with  the  Adam  optimizer,  the  same model achieved a precision of 0.901, a recall of 0.861, and an mAP50  of  0.915.  For  the  YOLOv9-E  model,  the  SGD optimizer resulted in a precision of 0.914, a recall of 0.87, and an  mAP50  of  0.92,  while  the  Adam  optimizer  achieved  the highest  performance  with  a  precision  of  0.925,  a  recall  of 0.874, and an mAP50 of 0.923. These findings indicate that the Adam optimizer is better suited for the extended YOLOv9 model,  whereas  the  SGD  optimizer  performs  slightly  better for the compact model in terms of precision. However,  the  study  revealed limitations,  particularly  the imbalance in the training data, which affected the performance for the  shield  class.  The  confusion  matrices  showed consistently lower prediction accuracy for this class due to its smaller  training  data  size.  Furthermore,  the  evaluation  was conducted  using  a  static  testing  set,  which  might  not  fully generalize to real-world scenarios. Nevertheless, we hope that our  experiment  will  help  people  being  more  diligent  in ensuring  the  use  of  personal  protective  equipment  in construction sites. ACKNOWLEDGEMENTS We  would  like  to  sincerely  thank  the  organizations  and platforms  that  significantly  contributed  to  this  research. We are  grateful  to  the  Google  Colab  platform  for  providing  an environment  and  essential  resources  that  facilitated  the training  of  our  models.  We  also  appreciate  the  Roboflow platform for its user-friendly interface and tools, which were instrumental in efficient data annotation