(14, 'Predicting_Comparison_of_Convolutional_Neural_Network_(CNN)_Using_PyTorch_from_Scratch_and_MobileNetV2_for_Accuracy_of_Cataract_Detection', 'Predicting Comparison of Convolutional Neural Network (CNN) Using PyTorch from Scratch and MobileNetV2 for Accuracy of Cataract Detection Ivan Adrian  School of Computer Science  Bina Nusantara University West Jakarta, Indonesia ivan.adrian@binus.ac.id lBernard Bereness School of Computer Science  Bina Nusantara University West Jakarta, Indonesia bernard.bereness@binus.ac.id Islam Nur Alam School of Computer Science   Bina Nusantara University  West Jakarta, Indonesia islam.alam@binus.ac.idLili Ayu Wulandhari School of Computer Science  Bina Nusantara University West Jakarta, Indonesia lili.wulandhari@binus.ac.id Abstract—Cataract is  an  eye  disease  that  causes  blindness. Many ophthalmologists can determine cataracts, but they have varying degrees of accuracy but not necessarily correct and take a long time to classify. This study aims to provide a comparison between  PyTorch  CNN  from  Scratch  and  MobileNetV2 Transfer  Learning  in  classifying  cataracts  using  eye  fundus images  and  fine-tuning  parameters.  In  the  results,  PyTorch CNN Scratch has a higher level of accuracy in testing 93.75%, but lower in training 93.75%. On the other hand, MobileNetV2 achieves high accuracy in training 97.86%, but low accuracy in testing 92.31% even though MobileNetV2 has been pretrained. This is caused by MobileNetV2 experiencing overfitting, making it difficult to generalize the data which will be caused by several factors starting from epoch, batch size or learning rate from fine tuning parameters. However, when the model uses the early stop parameter,  it  gets  higher  testing  results  93.08%  than  without using the early stop.  Keywords—Cataract, CNN, PyTorch, MobileNetV2  I.  INTRODUCTION  Nowadays  we  often  hear  about  eye  problems,  namely cataracts. Cataracts have become a major problem that many people suffer from all over the world. The cataract in question can be caused by lens hydration, namely an increase in fluid or caused by the protein denaturation process in the lens [1]. This ultimately results in loss of vision if medical treatment is not immediately sought and implemented [2]. Cataracts can generally  be  caused  by  age  factors  or  congenital  disorders that interfere with eye health [1]. The age factor here refers to  the  eye\'s  ability  to  carry  out  its  functions,  for  example  it can be triggered by glaucoma which can disrupt normal eye health. Cataracts  generally  occur  in  adults  aged  35  years  and over  or  elderly  people  aged  65  years  and  over  [6].  In  the medical world, doctors can detect cataracts by looking at the brightness level of the patient\'s eye fundus [1]. Various eye examinations are often carried out in the medical world, but in reality  they  take  a long  time  and  there is a  possibility  of errors in examination results due to outdated equipment [1]. Seeing the existing risks, artificial intelligence methods based on  image  classification  are  very  necessary  to  increase examinations. time accuracy This research aims to calculate the accuracy of cataract detection using Convolutional Neural Network (CNN) with save and eye in XXX-X-XXXX-XXXX-X/XX/$XX.00 ©20XX IEEE to be scratch  and  MobileNetV2  which  uses  transfer  learning  by evaluating the  speed  efficiency  of  both models  in  detecting cataracts.  People  can  check  independently  via  the  mobile application. If there is any suspicion about the results given, people can immediately visit an ophthalmologist. However, as with any technology, there are limitations to be aware of. This limitation is seen in the accuracy of cataract detection. This is because high accuracy is also influenced by the quality of the data and also the training used. Not only that, the loss of  important  information  that  can  only  be  identified  by  an ophthalmologist  in manual  diagnosis  is  also  something  that highlighted.  needs The  methods  we  use  to  classify  cataracts,  namely Convolutional  Neural  Network  (CNN)  with  Pytorch  from Scratch  and  CNN  using  a  model  or  architecture,  especially MobileNetV2.  In  general,  CNN  is  an  intelligence  in  Deep Learning, where it can recognize, classify and process image objects  used  as  parameters  effectively  and  efficiently.  So, CNN Scratch is a CNN whose training does not use existing architecture or models, but rather a CNN that is built from the ground  up.  CNN  is  divided  into  several  layers,  such  as Convolutional Layer, Pooling Layer, Rectified Linear Units (ReLU)  Activation,  Flatten,  Fully  Connected  Layer,  and Softmax Activation [1]. The advantage of this method is that it  can  extract  images  automatically  by  determining  the important  features  in  them,  then  the  weakness  of  CNN Scratch  is  that  it  requires  a  lot  of  data.  Meanwhile, MobileNetV2 was created to increase accuracy, performance, effectiveness and efficiency. MobileNetV2 is a development of  MobileNetV1  which  has  4  components  in  it,  such  as Depthwise  Separable  Convolutions  which  is  a  combination of Depthwise Convolution and Pointwise Convolution in the previous  MobileNet,  Linear  Bottlenecks  and  Inverted Residuals which are additional components in MobileNetV2 [7]. The advantages of this architecture are that it has higher accuracy than MobileNetV1 and reduces overfitting, then for the  weaknesses  of  MobileNetV2  itself  is  a  limitation  in dealing with wide variations. II.  LITERATURE REVIEW From  the  existing  background,  according  to  a  2021 image journal  on  cataract  detection  using fundus         classification and Convolutional Neural Network (CNN) by Indra  Weni  et.  al.  that  used  data  from  the  Kambang  Eye dataset  Hospital,  which  consisted  of  380  fundus  images consisting of 240 cataract images and 140 normal eye images in  patients,  concluded  that  the  addition  of  an  epoch  would certainly  affect  accuracy  and  loss.  By  using  digital  image processing on a multilayer layer perceptron (MLP) to process fundus image data, convolutional layers, activation functions, as  well  as  various  training  and  validation  processes  for accuracy  in  2  classes, namely  the normal  eye  class  and the cataract eye class, information was obtained that the higher the life value used, the model value will also have a very high influence, where the use of the highest epoch, which 50, also affects  the accuracy  in achieving  the highest  value, namely 95%, so that the inspection process also has a high level of accuracy [3].  Richard Bina et al. [1] proposed classification of cataract fundus images using a Convolutional Neural Network (CNN) which uses GoogleNet, MobileNet, ResNet, and proposed a Convolutional  Artificial  Neural  Network  using  additional classes into 4 classes and a dataset of up to 399 data  from Eye hospitals of North Sumatra (181 hypermature images, 73 normal images, 74 immature images, and 72 mature images) and 3200 data after augmentation. As a result, it was found that the proposed Convolutional Neural Network had the best results with an accuracy of 92%, then followed by MobileNet which also had 92%, ResNet with an accuracy of 93%, and finally GoogLeNet which was at 86%, whose results showed better high accuracy compared to manual feature extraction in  detecting  cataracts.  This  is  different  from  the  research conducted by Turimerla Pratap and Priyanka Kokil that used dataset  form  HRF,  STARE,  DIARETDB0,  E-ophtha, MESSIDOR, DRIVE, FIRE, DRIONS-DB, IDRiD with the total 0f 800 images from 4 classes (normal, mild, moderate, severe) which also used computers as a tool, but used deep transfer  learning,  where  Convolutional  Neural  Networks (CNN)  are  generally  drilled  to  extract  features  and  then connected using a Support Vector Machine (SVM) to carry out  classification.  The  results  after  carrying  out  four classification stages, obtained an accuracy of 92.91%, where it can be said that the use of CNN transfer learning is the right step in classifying cataracts because it minimizes overfitting which generally often occurs in scratch type CNNs and can be used when the training data is small, so the fundus image extraction technique is very appropriate when used with the CNN algorithm [8].  Hans Morales-Lopez et. al. states that by using the CNN technique,  when  CNN  sees  a  vectorized  image,  it  can immediately  divide  the  weights.  This  advantage  makes  the parameters  that  need  to  be  learned  by  CNN  reduced  and equivariant  to  the  input [9].  This  is  different  from research conducted  by  Nadim  Mahmud  et.  al.  where  using Convolutional  Neural  Network  and  Digital  Camera  Image (CNNDCI) technology has made it easier for people to detect cataracts through the camera on a cellphone or digital camera by  sending  image  footage  of  our  eyes.  The CNN algorithm applied uses two datasets which have the highest accuracy of 98.5%. The first dataset produces a very large accuracy value, because  it  is  divided  into  5  cross  validations,  where  each cross validation contains an image partition from the dataset. On  the  other  hand,  there  is  research  on  diseases  such  as cataracts,  diabetes,  myopia,  and  others.  This  research  uses four  deep learning-based  models,  namely  Resnet-34, EfficientNet,  MobileNetV2,  and  VGG-16  with  an  ODIR dataset containing 5000 fundus images. The VGG-16 model gets the highest accuracy compared to other models, namely 97.23%, this is because the model can learn various features in images and classify images well [10]. III.  METHODOLOGY   This  approach  uses  two  different  methods  to  start building a CNN from scratch using PyTorch and leveraging a pre-trained MobileNetV2 model (Transfer Learning). From the  CNN  side,  scratch  will  of  course  be  built,  trained  and thoroughly  tested  in the  PyTorch  framework,  to  understand the  basics  of  CNN  architecture  before  carrying  out  transfer learning.  Not  only  that,  here  MobileNetV2,  the  pre-trained model  will  be  used  and  compare  its  speed  with  CNN  from scratch.  On  the  other  hand,  we  use  an  architecture  called MobileNetV2  with  a  CNN  algorithm  which  has  the  main feature,  namely  Inverted  Residuals,  which  has  an  efficient effect on model performance [11]. MobileNetV2 is a Neural Network  architecture,  where  this  architecture is  very developed in terms of object classification.    Input from the system uses a fundus image of the cataract eye. Then the dataset will be processed in such a way through labeling  to  augmentation.  Data  that  has  been  preprocessed will be trained using the selected model until finally tested to determine this methodology  section,  details  regarding  the  methodology mechanism and how it works can be seen in Figure 1. the  accuracy  of two  models.  In the Fig. 1. Proposed Method Stages A.  Data Preprocessing   At the data collection stage, we searched for and used a dataset  consisting  of  400  eye  fundus  images,  consisting  of 300  normal  eye  images  and  100  cataract  eye  images.  This cataract eye dataset was obtained from Kaggle. The dataset format is also .png to ensure the dataset used is clear and can be detected well.    After  the  data  collection  stage  has  been  carried  out,  of course  the  existing  data must  be  labeled  so  as  not  to  cause confusion  in  classifying  the  fundus  images  obtained  [2]. Labeling must  also  be  done  clearly  and  consistently,  this is important  to  ensure  the  model  can  learn  to  differentiate fundus images accurately. This labeling process can be seen in Figure 2.           Fig. 2. Cataract & Normal Fundus Images In MobileNetV2 data will be divided into three folders such as train, valid, and test. On the other hand, PyTorch models will be divided into two folders, such as train and test. At the data extraction stage, this is done by unzipping the dataset file that  has  been  downloaded  from  Kaggle  using  the  internal drive where the data was uploaded. In this case, of course, the data must  conform  to the  appropriate  directory  structure  so that  it  can  be  extracted  perfectly.  For  example,  after extraction,  images  are  saved  in  folders  1_normal  and 2_cataract.  At  the  data  preprocessing  stage,  the  extracted image data will be further processed through conversion into tensors.  This  process  is  carried  out  using  transformations from torchvision.transforms [13]. Here we also perform data augmentation by flipping the image horizontally, rotating the image randomly up to 10 degrees to the left or right, changing the image size to 32x32 pixels, changing the image from PIL format  or  NumPy  array  to  tensor.  Data  normalization  was also carried out to increase the model convergence speed to the range [0, 1]. Then the data is loaded into DataLoader for batching and shuffling [13]. library function from  TensorFlow-keras  with In the  data  preprocessing  stage,  MobileNetV2  uses  the the built-in ImageDataGenerator for  normalization  and augmentation. The  size  of  the  input layer  is  224  x  224  x  3 (RGB). Next, the input will scale the pixel value from 0-255 to  0-1  [11].  After  the  rescaling  process  is  complete,  data augmentation  will  be  carried  out  which  aims  to  obtain  a image  variations.  The  data dataset  with  different augmentation used is by rotating the image randomly within a range of 20 degrees and flipping it horizontally. Apart from that, the zoom level was also carried out randomly at intervals of 0.2. B.   Model Definition    The CNN model in this study uses PyTorch with several convolution  layers,  a  ReLU  activation  layer,  and  a  pooling layer  [13].  The  first  convolution  layer  has  32  filters  with  a kernel size of 3x3, stride 1, and padding 1. The output of this layer  functions  through  ReLU  activation  and  dropout  with probability  0.3.  The  second  convolution  layer  also  has  32 filters  with  the  same  specifications,  followed  by  a  ReLU activation function and max-pooling with a kernel size of 2x2 [14].  Next,  the  flat  layer  converts  the  output  of  the convolution layer into a one-dimensional vector. This model has two full connection layers, with the first layer having 512 units  followed  by  a  ReLU  activation  function  and  dropout with  probability  0.5,  while  the  second  layer  has  10  units which  corresponds  to  the  number  of  classes  in  the  dataset which is the basis of the initial architecture [15]. The model can be seen in the Figure 4.  Fig. 3. Pytorch Model Architecture  ReLU: ????(????) = max(0,????) Convolutional  Neural  Network (CNN)  with MobileNetV2  architecture  uses  the  Depthwise  Separable Convolutions  (DSC)  technique  which  is  a  combination  of Depthwise  Convolution  and  Pointwise  Convolution  [7]. Using a combination of these techniques, DSC introduces a new  structure  called  Inverted  Residuals.  This  architecture also has  a  standard  convolution  which has  32  filters  with  a kernel size of 3x3, stride 2, padding 1. Apart from that, the convolution  layer  (Bottlenecks  Block)  uses  the  ReLU6 activation function. Global Average Pooling Layer is used to reduce  spatial  dimensions  to  very  small  sizes  such  as  1x1. This architecture can be seen as in the Figure 5. Fig. 4. Blocks in MobileNetV2 C.   Model Training The first step in model training is forward pass, namely inputting  data  through  the  network  to  produce  accurate predictions  [13];  then  proceed  with  loss  calculation,  which calculates the difference between the predicted label and the original  label  using  a  loss  function  such  as  Cross-Entropy Loss  [15];  backward  pass,  which  functions  to  calculate  the using loss backpropagation  [13];  optimization  that  updates  model parameters  using  an  optimizer  such  as  Adam  or  SGD  to finally determine the learning rate and direction of parameter updates  based  on  gradients  calculated  during  the  backward pass  [15];  epoch  which  is  one  full  cycle  through  the  entire data set, so that the model can learn patterns from the fundus against  model parameters gradient            image  data  [1];  and  tracking  accuracy  recorded  during training. In  the  training  process  on  MobileNetV2,  we  use  the weights of the ImageNet dataset obtained from the Keras [17] application  without  a  top  layer  or  what  is  called  a  fully connected  layer.  It  also  added  custom  layers,  such  as  the Global Average Pooling Layer, Dense with 128 units which uses the ReLU activation function, along with an Output layer to produce probability predictions. So that the weights do not change during training, the base model layers are frozen, so this  prevents  overfitting  that  occurs  in  the  model  during training  and  provides  training  time  efficiency  [17].  In  this compilation  process,  the  Adam  optimization  algorithm  is to  provide  efficient  and  effective  predictions.  used D.   Model Testing      After training steps, it is a must to evaluate the model [2]. Good  accuracy  is  used  to  measure  how  well  the  model predicts the correct label compared to the actual label. In the case  of  cataract  detection,  other  metrics  such  as  Precision, Recall,  and  F1-Score  can  be  used  for  more  in-depth evaluation,  so  it  is  said  to  be  a  solution  to  the  binary classification  problem  [1].  Not  only  that,  precision  will  of course measure the proportion of correct positive predictions out of all positive predictions [3]. This is also balanced with recall  which  measures  the  proportion  of  correct  positive predictions  out  of  all  actual  positive  cases.  It  doesn\'t  stop there, there is the F1-Score which is a harmonious average of precision and recall in order to provide an idea of the balance between the  system\'s two.  The  measurement  of performance is shown in the measurement below [16]. the ????????  +  ????????????????  +  ????????  +  ????????  +  ????????  ???????????????????????????????????? =  ????????????????+???????????????????????????????? =  ???????????????? + ????????????1 − ???????????????????? = 2 ???????????????????????????? ???? ???????????????????????????????????????????????????????? + ????????????????????????????????????IV.  RESULT AND DISCUSSION   The cataract fundus image consists of 400 images labeled 1_normal  and  2_cataract.  They  are  Convolutional  Neural Network and MobileNetV2  from  transfer  learning.  The  results  of  tuning parameters in Pytorch from Scratch can be seen in Table 2. (CNN)  with  Pytorch from  Scratch TABLE I Pytorch from Scratch Accuracy Result   Based  on  table  1,  it  can  be  seen  that  with  the  change  in epoch  from  50  to  100,  the  resulting  accuracy  in  the  train, validation  and test  set  will  also  continue to  be  higher. This change in accuracy was seen in the 1st and 4th experiments as well as the 2nd and 4th experiments. A learning rate set lower (0.001)  actually  provides  better  accuracy  compared  to  a learning rate set higher (0.003). This difference in accuracy was seen in the 1st and 3rd experiments and compared with the 2nd and 4th experiments. 4. On the other hand, testing on a smaller  batch  size,  namely  32,  actually  produces  better accuracy  compared  to  a  larger  batch  size,  namely  64.  The change in accuracy due to batch size is clearly visible from the  results  of  the  1st  and  2nd  test,  as  well  as  the  3rd  and  4th experiments.  Parameter  updates  in  small  batches  help  the model  become  faster  and  more  focused  to  deliver  the  best accuracy. Tuning parameters with epoch 100, batch size 32, and  learning  rate  0.001  gave  the  best  results  with  93.75% accuracy on the training, validation, and test sets. This means that  the  combination  of  parameters  chosen  to  test  has managed to find an optimal balance between training patterns in the data, more frequent parameter updates, and a learning rate that is small enough to create the best training stability. Not  only  that,  testing  of  the  training  results  can  be  seen  in table 2. TABLE II Pytorch Precision, Recall, and F1-Score Result   From table  2,  the  combination  of  parameters  with  epoch 50, batch size 32, and learning rate 0.001 actually produces balanced precision, recall, and F1-score of 85%. This shows that  with  this  combination,  the  model  is  quite  good  at detecting  cataracts  without  significant  bias.  On  the  other hand,  the  combination  of  epoch  50,  batch  size  64,  and learning  rate  0.003  actually  gives  very  bad  results  where precision is  only  10%, recall  20%, and  F1-score  34%. This shows  that  the  model  with  this  combination  is  not  able  to detect cataracts well. Poor accuracy is of course caused by a learning rate that is too high and a batch size that is too large, which  means  the  model  cannot  be  trained  centrally  well. Apart from that, with epoch 100, batch size 32, and learning rate 0.001 which already shows very high recall (75%), very low  precision  (10%),  it  produces  an  F1  score  of  86%.  The results of these figures actually show that this model contains a  lot  of  false  positives,  which  means  it  detects  too  many cataract  cases  that  actually  don\'t  exist  or  don\'t  need  to  be detected.  To  complete  this  combination,  epoch  100,  batch size  64,  and  learning  rate  0.003  actually  provide  high precision  (87%)  and  lower recall  (65%)  and  produce  an  F1 score  of  74%.  The  combined results in  the model are more conservative  in  efforts  to  detect  cataracts,  thereby  reducing the number of false positives but causing the neglect of some cataract cases that should actually be detected. If  compared  again  in  table  2,  the  combination  of  batch sizes 32 and 64, a smaller batch size (32) at epoch 50 and a learning  rate  of  0.001  produces  balanced  results  between precision, recall and F1-score. If the batch size is made larger, namely  64  with  the  same  settings,  the  model  performance actually  experiences  a  significant  decrease.  The analysis  of the changes above has shown that tuning with a smaller batch size  will  certainly  help  the  model  learn  better  and  more stably. On the other hand, at 100 epochs and a learning rate of 0.001, and a batch size of 32 has produced very high recall but  very  low  precision.  Meanwhile,  batch  size  64  produces                high  precision  with  lower  recall.  This  analysis  certainly shows that the trade-off between precision and recall with a larger batch size tends to provide better precision than other combinations. The map of changes in accuracy from training and validation can be seen in the following figure 6 and 7. Fig. 6. Experiment on Epoch 50 Fig. 7. Experiment on Epoch 100 From  Figure  6,  the  left  image  does  not  experience overfitting  or  underfitting  so  it  is  consistent  in  training, validation  and  testing.  On  the  other  hand,  the  right  image suffers  from  underfitting  where  the  validation  and  testing accuracies  are  lower  than  the  training  accuracy,  which indicates that the model did not learn well enough from the entire trained data. Likewise, from Figure 7, the left image is stable,  but  the  right  image  actually  experiences  overfitting, where  the  training  accuracy  is  higher  than  validation  and testing, but not significantly.  TABLE III MobileNetV2 Accuracy Result   Based on table 3, it can be seen that in the combination (BS:  32,  Ep:  50, 